import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <div className="header-button">
      <button type="button" class="btn btn-secondary btn-lg">Login</button>
      <button type="button" class="btn btn-secondary btn-lg">Register</button>
      </div>
    </div>
  );
}

export default App;
